import { get, sync } from 'vuex-pathify';

export default {
  name: 'AppBar',
  computed: {
    appTitle: get('app/appTitle'),
    drawer: sync('app/drawer'),
    bar: sync('app/bar'),
  },
  methods: {
    goBack() {
      this.$router.go(-1);
    },
    goIndex() {
      this.$router.push('/');
    },
    showSnackBar() {
      this.drawer = !this.drawer;
    },
  },
};
